function statisticsAuctionEnd(data, kam){
    console.log('fire post data auctionEnd: '+kam);
    console.log(data);
    var device = '';
    var platform = navigator.platform; // string
    var language = navigator.language.toLowerCase(); // string
    var cookieEnabled = navigator.cookieEnabled; // true/false
    var innerWidth = window.innerWidth; // number
    var innerHeight = window.innerHeight; // number
    var timeA = 0;
    if (typeof imTimeAuctionEnd !== 'undefined') {
        timeA = (imTimeAuctionEnd - imTimeStart); // number
    }

    if(imHbMbIsMobile.any()){
        console.log('imHbMbIsMobile mobile');
        console.log(imHbMbIsMobile);
        device = 'mobile';
    }else{
        console.log('imHbMbIsMobile PC');
        console.log(imHbMbIsMobile);
        device = 'pc';
    }
    var browserInfo = '&device='+device+'&platform='+encodeURIComponent(platform)+'&language='+encodeURIComponent(language)+'&cookieEnabled='+cookieEnabled+'&innerWidth='+innerWidth+'&innerHeight='+innerHeight+'&timeA='+timeA ;
    console.log('browserInfo: '+browserInfo);
    if(typeof data === 'object'){
        if(data.ext){
            data.ext = null;
            console.log('fire data ext(R2B2)');
            console.log(data);
        }else{
            console.log('fire NO data ext(R2B2)');        
        }
    }

//  var strData = JSON.stringify(data);
    var strData = encodeURIComponent(JSON.stringify(data));    
    console.log('strData: '+strData);

    var hbmasterscript = 'hb-0';
    var selection = document.body.getAttribute('data-hbmasterscript') !== null;
    if (selection) {
        hbmasterscript = document.body.getAttribute('data-hbmasterscript');    
    }
    console.log('statisticsAuctionEnd hbmasterscript: '+hbmasterscript); 

    var xhr = new XMLHttpRequest();
    xhr.open('GET', 'https://hb.impressionmedia.cz/statistics/'+kam+'.php?configId=1309&statistics=1&hbmasterscript='+hbmasterscript+browserInfo+'&data='+strData);
//  xhr.setRequestHeader('Content-Type', 'application/json');
    xhr.onreadystatechange = function () {
      // In local files, status is 0 upon success in Mozilla Firefox
      if(xhr.readyState === XMLHttpRequest.DONE) {
        var status = xhr.status;
        if (status === 0 || (status >= 200 && status < 400)) {
          // The request has been completed successfully
          console.log('xhr.responseText');          
          console.log(status + ': ' + xhr.responseText);
        } else {
            console.log('error in xhr');
          // Oh no! There has been an error with the request!
        }
      }
    };
    xhr.send();

}

